import Foundation

struct FakeRestCountryService: RestCountryServiceable {

    func listAll(success: @escaping ([ApiCountry]) -> Void, failure: @escaping (Error?) -> Void) {
        let list = try! JSONDecoder().decode([ApiCountry].self, from: json.data(using: .utf8)!)
        success(list)
    }
}

